import React from "react";
import { StyleSheet } from "react-native";

export const style = StyleSheet.create({
    container: {
        width: 250,
        height: 250,
        backgroundColor: '#152238',
        borderRadius: 10,
        display: 'flex',
        padding: 10
    },
    title: {
        color: 'white',
        fontSize: 20
    },
    cardimage: {
        width: 250,
        height: 250,
        borderRadius: 10
    }
})
